import { CommonActions }                                         from '@react-navigation/native';
import React                                                     from 'react';
import { View, StyleSheet, TouchableOpacity, Image, ScrollView } from 'react-native';

import { createBottomTabNavigator }               from '@react-navigation/bottom-tabs';
import { Text, BottomNavigation, Appbar, Button } from 'react-native-paper';
import Icon                                       from 'react-native-vector-icons/MaterialCommunityIcons';
import { Color, fontColor }                       from '../assets/themeColor';

const Tab = createBottomTabNavigator();

export default function BottomNavigationComponent(props) {
  return (
    <Tab.Navigator
      screenOptions={ {
        headerShown: false,
      } }
      tabBar={ ({ navigation, state, descriptors, insets }) => (
        <BottomNavigation.Bar
          style={ { backgroundColor: Color } }
          labeled={ false }
          compact={ true }
          navigationState={ state }
          safeAreaInsets={ insets }
          onTabPress={ ({ route, preventDefault }) => {
            const event = navigation.emit({
              type: 'tabPress',
              target: route.key,
              canPreventDefault: true,
            });

            if (event.defaultPrevented) {
              preventDefault();
            }
            else {
              navigation.dispatch({
                ...CommonActions.navigate(route.name, route.params),
                target: state.key,
              });
            }
          } }
          renderIcon={ ({ route, focused, color }) => {
            const { options } = descriptors[route.key];
            if (options.tabBarIcon) {
              return options.tabBarIcon({ focused, color: fontColor, size: 30 });
            }

            return null;
          } }

        />
      ) }
    >
      <Tab.Screen
        name="Home"
        options={ {
          tabBarIcon: ({ color, size }) => {
            return <Icon name="home" size={ size } color={ color }/>;
          },
        } }
      >
        { () => <HomeScreen navigation={ props.navigation }/> }
      </Tab.Screen>
      <Tab.Screen
        name="Settings"
        component={ SettingsScreen }
        options={ {
          // tabBarLabel: 'Settings',
          tabBarIcon: ({ color, size }) => {
            return <Icon name="cog" size={ size } color={ color }/>;
          },
        } }
      />

      <Tab.Screen
        name="Add"
        component={ SettingsScreen }
        options={ {
          // tabBarLabel: 'Settings',
          tabBarIcon: ({ color, size }) => {
            return <Icon name="cog" size={ size } color={ color }/>;
          },
        } }
      />

      <Tab.Screen
        name="Remove"
        component={ SettingsScreen }
        options={ {
          // tabBarLabel: 'Settings',
          tabBarIcon: ({ color, size }) => {
            return <Icon name="cog" size={ size } color={ color }/>;
          },
        } }
      />
    </Tab.Navigator>
  );
}

